import React from "react";

class Contact extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isSubmitted: false
    };
  }

  handleSubmit() {
    this.setState({ isSubmitted: true });
  }
  render() {
    return (
      <div className="contacts">
        <h1>Contact</h1>
        <p>お問い合わせはこちらからお願い致します。</p>
      </div>
    );
  }
}

export default Contact;
